import './App.css';
impo

function App() {
  return (
    <div className="App">
      <Router>
        <div className='container'>

          <HeaderComponent />
          <div className="container">
            <Routes >
            <Route path="/" element={<ListPlanComponent />} />

            </Routes>
          </div>
          <FooterComponent />
        </div>
      </Router>
    </div>
  );
}

export default App;
